import styled from "styled-components";

const Container = styled.div`
  margin: var(--size) auto;
  border-radius: var(--size);
  padding: var(--size);
  width: 85%;
  max-width: 1000px;
  min-width: 200px;
  min-height: 100vh;
`;

export default Container;
